CREATE SCHEMA waterflow_statistic;

CREATE TABLE waterflow_statistic.season (
  ogc_fid integer NOT NULL,
  objectid bigint NOT NULL,
  old_station_number character varying(32),
  station_id character varying(32),
  statistical_period character varying(36) NOT NULL,
  observation_count bigint NOT NULL,
  catchment_area double precision NOT NULL,
  avg double precision NOT NULL,
  std_dev double precision NOT NULL,
  max double precision NOT NULL,
  p99 double precision NOT NULL,
  p95 double precision NOT NULL,
  p90 double precision NOT NULL,
  p75 double precision NOT NULL,
  p50 double precision NOT NULL,
  p25 double precision NOT NULL,
  p10 double precision NOT NULL,
  p5 double precision NOT NULL,
  p1 double precision NOT NULL,
  min double precision NOT NULL,
  id_lokalid character varying(200) NOT NULL,
  registration_from timestamp with time zone NOT NULL,
  registration_to timestamp with time zone,
  season character varying(28) NOT NULL,
  CONSTRAINT FK_1 FOREIGN KEY ( station_id ) REFERENCES hydrometry.station ( station_id )
);

CREATE INDEX waterflow_statistic_season_IDX ON waterflow_statistic.season
(
  station_id,
  statistical_period
);

